import Dropdown from './Dropdown.js'
import Grid from '@material-ui/core/Grid';
import Map from "./Map.js"; 
import ReactTooltip from "react-tooltip";
import Textfield from './Textfield.js';
import { makeStyles } from '@material-ui/core/styles';
import React, { useEffect, useState } from 'react';
import WillitendService from '../services/Willitend.service.js';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));


var is_load_failed = false;
var is_load = false;

export default function Home() {

    const classes = useStyles();
    const [place, setPlace] = useState("");
    const [stateTooTiplInfo, setStateTooTiplInfo] = useState(""); 
    const [stateInfoImmunity, setStateInfoImmunity] = useState([]);
    useEffect(() => {
      WillitendService.getAllStateInfo()
      .then(return_data =>{
      setStateInfoImmunity(return_data.data)
      })
      .catch(err=>{
        alert(err);
        is_load_failed = true;
        console.log("Unable to Loaded");
        }
      );
      console.log("Home ==> state info has been loaded");
      is_load = true;
      console.log(stateInfoImmunity.length);
      },[]);

    function getDataFromBackend () {
    /*
    Make backend call to fetch the data for the state and then return the result using rowId
    */

    /* hard coded for now */ 
    var data = {
      herdImmunityDays : 12, 
      vaccPerDay: 144, 
      fullVac: 10, 
      partialVac: 23
    }

    return data; 
  }

  var data = getDataFromBackend();
    const handlePlaceChange = (place) => {
      setPlace(place);
  }; 

  return (
    <div className={classes.root} >
     <Grid container = {true} direction = "row" justify = "center" alignItems = "center" spacing = {3}>    
    <Grid item  xs = {12} md = {9}> 
    <Map setToolTipContent = {setStateTooTiplInfo} stateInfoImmunity = {stateInfoImmunity}/>
    <ReactTooltip type = "light" multiline html border >{stateTooTiplInfo}</ReactTooltip>
    </Grid>
     <Grid item xs = {12} md = {3} spacing = {3} > 
      <Dropdown place ={place} onPlaceChange = {handlePlaceChange} />
      <Textfield place = {place}/>
    </Grid> 
    </Grid>

    </div>
  );
}
